CREATE TABLE replicats (
replicat_id integer NULL,
replicat_name VARCHAR (500) NOT NULL,
replicat_extracts VARCHAR (500) NOT NULL,
correlation numeric NOT NULL,
hyb_cutt_off numeric NOT NULL,
rep_type VARCHAR (10) NOT NULL,
link_rep smallint NOT NULL,
note VARCHAR (4000) NOT NULL,
project_id integer NOT NULL,
experiment_id integer NOT NULL,
user_id integer NOT NULL,
submission_date date NOT NULL );
